    END,
    updatedat = NOW()
    WHERE symbol IN ('CTDD', 'FNDE', 'CGIB', 'NRSH', 'FPEI', 'KCSH', 'FMNY', 'SHYG', 'RODE', 'FTWO', 'FNK', 'IWR', 'ONLN', 'DUSL', 'MINO', 'ISHP', 'KNGZ', 'NSCR', 'SMIN', 'MSTI');